import 'animate.css'
import React from "react";
import loadingPic from './loading.png'
const LandingPage = () => {
  return (
    <main className='w-flex justify-center align-middle items-center animate__animated animate__fadeut animate__delay-3s'>
      <div className="flex justify-center align-middle items-center">
        <img className=" h-32 " height="100" width="100" src={loadingPic}/>
      </div>
      
    </main>
  );
};



export default LandingPage;
